(2, 'Earth Dance', '2017-10-13', '23:00:00', 'Ngong Racecourse', '               Nairobis number one charity dance music festival Earthdance Nairobi is here yet again. The Kenyan edition of this global peace party will be happening on Saturday 30th September at The Ngong Racecourses tranquil Waterfront. This years event features three mighty stages, each to their own representing the core movements in Kenyas music scene. Along with the banging soundtrack we will retain the BYOB (Bring Your Own Bottle) bar system which seems to have become somewhat of an Earthdance staple. Prepare yourself for the ultimate festival experience in Nairobi to date!', 500, , 500);
