(3, 'All Things Work Together', '2017-11-04', '23:59:00', 'Memphis TN', '           \"This is my favorite album and the most work I\'ve put in since the Anomaly tour,\" said Lecrae. \"This is a spiritual and emotional musical journey. People will be blown away.\"\r\n\r\nNever afraid to move the needle, few would argue that his much anticipated Columbia Records debut album (All Things Work Together) comes at a pivotal moment for the artist, as hip hops torrent now moves to him.    \r\n\r\nSurging or insurgent - depending on your point of view - hes blessed with a visionary verbal arsenal and an abiding faith thats piloted a unique career trajectory defying the typical hip hop storyline.  The system may not have planned for this, wrote Vibe about Lecrae, but its definitely coming around. More caught than taught, is how the artist describes his incredible journey that includes two Grammys, a history-making #1 album with his masterful 2014 offering, Anomaly (topped multiple categories, including the Billboard 200 and is RIAA Gold certified), and a compelling live resume, most recently notching a headlining 2016 Destination tour which Lecrae says was about real unity, not pretend unity.  He continues to thoughtfully engage the culture, reeling off a NY Times Bestseller (last years riveting memoir Unashamed) and a breakthrough spoken word performance at the BET Hip Hop Awards last fall that had the Twittersphere heralding his arrival as truth-telling firebrand.  BET hailed it as an epic poem, of necessary affirmations.      ', 3000, , 300);
